import React from "react";
import { Nav, NavLink, NavMenu } from "./FooterElements.js";

import "../../styles/footer.css";

const Footer = () => {
  return (
    <div className="phantom">
      <div className="footer">

        <Nav>
        <a href="www.linkedin.com/in/laura-jankowski-b795611ab" >
          <img
            src="https://img.favpng.com/25/4/21/linkedin-facebook-social-media-font-awesome-icon-png-favpng-QRqmwk6cNZRQZwxSAJpYRt4Rf_t.jpg"
            alt="linkedin link"
            width=""
          ></img>
        </a>
          <NavMenu>
            <NavLink to="/about" activeStyle>
              About
            </NavLink>
            <NavLink to="/services" activeStyle>
              Services
            </NavLink>
            <NavLink to="/contact-me" activeStyle>
              Contact Me
            </NavLink>
            {/* Second Nav */}
            {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
          </NavMenu>
        </Nav>
      </div>
    </div>
  );
};

export default Footer;
